997715;s:13:"vod_time_hits";i:0;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:1232:"民視八點檔《幸福來了》3日晚大結局，平均收視6.12創新高接檔戲為王珮華製作的《大時代》首播，平均收視4.85，受到年輕女性族群最多的關注，廣告主最愛的族群成長最多。台灣天后陳美鳳扮演的武則天初登場，收視率達到6.58；江祖平的養女報恩之心，幫弟妹磕頭求饒要一手撐起這個家，讓不少觀眾大讚《大時代》充滿溫馨情感，劇中江俊翰不流利的台語也惹出不少笑話，全劇吸引近214萬人觀看。劇組今準備蔥花捲、紅色跟金色包子慶功，江祖平、Gino、江俊翰、郭子乾、張柏舟、羅巧倫帶領第二部曲演員楚宣、余秉諺、李又汝、郭亞棠、成潤、張家瑋、馬俊麟陳彥廷、黃少谷等人齊聚慶賀。製作人王珮華感謝民視給的機會，「假的東西不會長久，戲的質感才是重點」，也感謝演員盡全力的配合跟幫忙。劇中「養女」江祖平表示第一名的收視是大家共同打拼，大家相處一個月，讀本就想哭，但也強調哭戲中還有很多彩蛋，接下來有很多笑點會讓大家耳目一新，值得期待，演員昨晚一起看首播，江祖平自己也看到落淚。";s:13:"vod_play_from";s:6:"gqm3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:15858:"61$https://gaoqing2.gqzyz.com/2018/09/26/wKUWKRRPrfKHQ7ni/playlist.m3u8#62$https://gaoqing2.gqzyz.com/2018/09/27/JhAyrxcojEhSXGC3/playlist.m3u8#63$https://gaoqing2.gqzyz.com/2018/09/28/Rf37Z7kJ8wo8DkGV/playlist.m3u8#64$https://gaoqing2.gqzyz.com/2018/09/29/PWYy8nUIdIsM8KeV/playlist.m3u8#65$https://gaoqing2.gqzyz.com/2018/10/02/KShZDedak3cJ5AAn/playlist.m3u8#66$https://gaoqing2.gqzyz.com/2018/10/03/0DPjhJraY0pWoLg0/playlist.m3u8#67$https://gaoqing2.gqzyz.com/2018/10/04/fz11snmRbSFaWUqq/playlist.m3u8#68$https://gaoqing2.gqzyz.com/2018/10/06/FwrOrxbL6aktpEZU/playlist.m3u8#69$https://gaoqing2.gqzyz.com/2018/10/06/mhr4GmoN14tFgSht/playlist.m3u8#70$https://gaoqing2.gqzyz.com/2018/10/09/g6p2yfDnIt7bRlzE/playlist.m3u8#71$https://gaoqing2.gqzyz.com/2018/10/10/HyAIVrOeXhkSQZCo/playlist.m3u8#72$https://gaoqing2.gqzyz.com/2018/10/11/WPCgcEhi9JE2i2aP/playlist.m3u8#73$https://gaoqing2.gqzyz.com/2018/10/12/nlLgU1LZx0THzdTS/playlist.m3u8#74$https://gaoqing2.gqzyz.com/2018/10/13/oTHWqk9wArhbUPc6/playlist.m3u8#75$https://gaoqing2.gqzyz.com/2018/10/16